import React, { useState, useEffect } from 'react';
import { WebSocketProvider, useWebSocket } from 'react-use-websocket'; // Substitua pelo caminho real da biblioteca WebSocket que você está usando

const App = () => {
  const [tag, setTag] = useState('');

  const { send } = useWebSocket('ws://localhost:8082'); // Substitua pelo endereço do seu servidor WebSocket

  useEffect(() => {
    send('');

    const handleMessage = (message) => {
      setTag(message);
    };

    return () => {
      send('');
    };
  }, [send]);

  return (
    <div>
      <h1>Current RFID Tag: {tag}</h1>
    </div>
  );
};

const Tagform = () => (
  <WebSocketProvider url="ws://localhost:8082"> {/* Substitua pelo endereço do seu servidor WebSocket */}
    <App />
  </WebSocketProvider>
);

export default Tagform;
